webpackJsonp([0xe3cc6dd8b539],{722:function(i,l){i.exports={data:{site:{siteMetadata:{title:"Magicly's Blog",author:"Magicly"}},markdownRemark:{id:"/Users/spring/Developer/Gatsby/gatsby-blog/src/pages/tools-used.md absPath of file >>> MarkdownRemark",html:'<p>这两天整理一下以前的收藏夹， 发现很多以前花时间学过的但是早就不用了的技术资料， 心生感慨，记录下来留作纪念吧。</p>\n<p>很多已经打不开了， 而居然发现有些好几年前工作中写的代码还在线上， 惊喜。</p>\n<p><strong>排序没有啥意义， 只是整理顺序， 有些分类也不是很合理。 另外有些技术已经过时， 有些没有过时但是现在我不用了， 有些还在使用。</strong></p>\n<h1 id="前端"><a href="#%E5%89%8D%E7%AB%AF" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>前端</h1>\n<ul>\n<li>浏览器兼容性， IE6！！！</li>\n<li>jQuery 以及各种插件</li>\n<li>圆角实现</li>\n<li>各种编码乱码问题</li>\n<li>跨域</li>\n<li>用 Web 做 ppt</li>\n<li>各种浏览器（Firefox，Opera，Chrome， IE， Safari）以及插件</li>\n<li>HTTP 各种 status</li>\n<li>Cache</li>\n<li>Emmet</li>\n<li>Angular</li>\n<li>React</li>\n<li>浏览器插件开发</li>\n<li>微信公众号开发</li>\n<li>如何在手机上调试 H5</li>\n</ul>\n<h1 id="java"><a href="#java" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Java</h1>\n<ul>\n<li>阻塞非阻塞，同步异步， NIO， AIO</li>\n<li>Enum</li>\n<li>Classloader</li>\n<li>Netty</li>\n<li>Mina</li>\n<li>Excel</li>\n<li>Spring</li>\n<li>Hibernate</li>\n<li>Structs</li>\n<li>Servlet / JSP / JSTL</li>\n<li>Tomcat / Jetty</li>\n<li>Eclipse / Idea</li>\n<li>Ant</li>\n<li>Zookeeper</li>\n<li>设计模式</li>\n<li>Concurrency: JDK 库, fork/join, Disruptor, actor(Akka)</li>\n<li>内存模型</li>\n<li>Socket</li>\n<li>单点登录</li>\n<li>Session / Cookie</li>\n<li>计算各种对象所占内存大小</li>\n<li>安全地实现单例模式， Double-checked locking, Enum, Static class</li>\n<li>Annotations</li>\n</ul>\n<h1 id="编程语言"><a href="#%E7%BC%96%E7%A8%8B%E8%AF%AD%E8%A8%80" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>编程语言</h1>\n<ul>\n<li>Ruby</li>\n<li>Scala</li>\n<li>LISP / Clojure</li>\n<li>F#</li>\n<li>Haskell</li>\n<li>JS / TS</li>\n<li>CoffeeScript</li>\n<li>Flow</li>\n<li>AWK &#x26; Sed</li>\n<li>SML</li>\n<li>Lua</li>\n<li>C</li>\n<li>C++</li>\n<li>Object-C</li>\n<li>Swift</li>\n<li>Go</li>\n<li>Rust</li>\n<li>Python</li>\n<li>PHP</li>\n<li>Matlab / Octave</li>\n</ul>\n<p>有很多只是简单了解了下， 没有深入使用。 比较熟悉的有 Java/Scala/JS/TS, 现在用 Typescript 较多。</p>\n<h1 id="函数式编程"><a href="#%E5%87%BD%E6%95%B0%E5%BC%8F%E7%BC%96%E7%A8%8B" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>函数式编程</h1>\n<h1 id="scala"><a href="#scala" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Scala</h1>\n<ul>\n<li>sbt</li>\n<li>scalaz</li>\n<li>Akka</li>\n<li>Spray</li>\n<li>Play!</li>\n<li>Lift</li>\n<li>Scalatra</li>\n<li>ScalaTest</li>\n<li>Scala.js</li>\n<li>Scala vim 开发环境配置</li>\n<li>Scala Android: scaloid</li>\n<li>Scala-ios</li>\n<li>Scala Native</li>\n</ul>\n<h1 id="app"><a href="#app" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>APP</h1>\n<ul>\n<li>Scala Android: scaloid</li>\n<li>Scala-ios， 还有其他语言开发 ios 的</li>\n<li>PhoneGap / Cordova</li>\n<li>ionicframework</li>\n<li>React Native</li>\n</ul>\n<h1 id="vim--emacs"><a href="#vim--emacs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Vim &#x26; Emacs</h1>\n<p>两个都用过，花了时间去配置成<strong>IDE</strong>，现在主要用 VSCode / Idea / XCode。。。。Vim 最大的影响就是不管用什么编辑器或 IDE，都要装 Vim 插件， 不然很不习惯。</p>\n<h1 id="各种免费-fq-方式"><a href="#%E5%90%84%E7%A7%8D%E5%85%8D%E8%B4%B9-fq-%E6%96%B9%E5%BC%8F" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>各种免费 FQ 方式</h1>\n<ul>\n<li>ssh 隧道</li>\n<li>IPv6 隧道</li>\n<li>各种代理</li>\n<li>VPN</li>\n<li>Goagent</li>\n<li>Tor</li>\n</ul>\n<p>现在主要用 lantern 和 ss， 踏踏实实花钱买， 省事儿。</p>\n<h1 id="reactive--fpr"><a href="#reactive--fpr" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Reactive &#x26; FPR</h1>\n<ul>\n<li>RxJava</li>\n<li>RxJS</li>\n</ul>\n<h1 id="正则表达式"><a href="#%E6%AD%A3%E5%88%99%E8%A1%A8%E8%BE%BE%E5%BC%8F" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>正则表达式</h1>\n<h1 id="github-pages-搭建-blog"><a href="#github-pages-%E6%90%AD%E5%BB%BA-blog" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>github pages 搭建 blog</h1>\n<ul>\n<li>Jekyll</li>\n<li>Hexo</li>\n<li>Gatsby（现在在用的）</li>\n</ul>\n<h1 id="linux"><a href="#linux" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Linux</h1>\n<ul>\n<li>fedora</li>\n<li>ubuntu</li>\n<li>系统性能诊断</li>\n<li>Shell</li>\n</ul>\n<p>最早的时候要刻四张光盘安装， 后来用 U 盘安装。</p>\n<h1 id="爬虫--搜索引擎"><a href="#%E7%88%AC%E8%99%AB--%E6%90%9C%E7%B4%A2%E5%BC%95%E6%93%8E" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>爬虫 &#x26; 搜索引擎</h1>\n<ul>\n<li>Lucene</li>\n<li>Solr</li>\n<li>nutch</li>\n<li>Scrapy</li>\n</ul>\n<h1 id="算法、大数据、mlai"><a href="#%E7%AE%97%E6%B3%95%E3%80%81%E5%A4%A7%E6%95%B0%E6%8D%AE%E3%80%81mlai" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>算法、大数据、ML/AI</h1>\n<ul>\n<li>Mahout</li>\n<li>OpenCV</li>\n<li>SIFT</li>\n<li>OCR / Tesseract</li>\n<li>LeetCode</li>\n<li>ACM</li>\n<li>自然语言处理</li>\n<li>word2vec</li>\n<li>神经网络，CNN / RNN</li>\n<li>推荐， 协同过滤， 矩阵分解</li>\n<li>Bloom filter</li>\n<li>MCTS</li>\n<li>五子棋， 国际象棋</li>\n</ul>\n<h1 id="web-安全"><a href="#web-%E5%AE%89%E5%85%A8" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Web 安全</h1>\n<ul>\n<li>XSS</li>\n<li>CSRF</li>\n<li>浏览劫持</li>\n<li>HTTPS</li>\n<li>对称加密， 非对称加密， Hash， 随机数</li>\n</ul>\n<h1 id="db"><a href="#db" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>DB</h1>\n<ul>\n<li>mysql， 各种索引优化，复合索引。。。</li>\n<li>Postgrel</li>\n<li>MongoDB</li>\n<li>Memcached</li>\n<li>Redis</li>\n<li>ssdb</li>\n</ul>\n<h1 id="nodejs"><a href="#nodejs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Node.js</h1>\n<ul>\n<li>Express</li>\n<li>Koa</li>\n<li>Egg</li>\n<li>meteor</li>\n</ul>\n<h1 id="测试"><a href="#%E6%B5%8B%E8%AF%95" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>测试</h1>\n<ul>\n<li>单元</li>\n<li>自动化测试</li>\n<li>截图测试</li>\n<li>Property based Testing</li>\n<li>压力测试</li>\n</ul>\n<h1 id="其他"><a href="#%E5%85%B6%E4%BB%96" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>其他</h1>\n<ul>\n<li>DSL</li>\n<li>Git</li>\n<li>自由职业</li>\n<li>敏捷开发</li>\n<li>重构</li>\n<li>Firebase / Clouda</li>\n<li>GTD</li>\n<li>魔术</li>\n<li>羽毛球</li>\n<li>旅游 / 摄影</li>\n<li>飞叠杯</li>\n<li>。。。。</li>\n</ul>\n<h1 id="比特币！！！"><a href="#%E6%AF%94%E7%89%B9%E5%B8%81%EF%BC%81%EF%BC%81%EF%BC%81" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>比特币！！！</h1>\n<p>最后， 发现自己 2011 年的时候看了一篇比特币的报道， <a href="http://www.bitecoin.com/online/2011/05/61.html">“比特币是个骗局”，吗？</a>！！！</p>\n<h1 id="总结"><a href="#%E6%80%BB%E7%BB%93" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>总结</h1>\n<p>由于东西太多了， 目前并没有整理完， 定期整理资料是一个好习惯， 删除东西真的很爽，因为删的都是自己已经了解不需要了的东西。</p>\n<p>不要只做资料收藏着， 要转化为自己的知识。</p>\n<p>另外也可以看出， 很多以前花了很多时间研究的东西， 其实早就被淘汰了， 所以很多时候我们不要太纠结技术， 而要关注解决问题本身！</p>\n<p>因为， 终究， 所有技术都会死的， 我们也是。。。</p>',timeToRead:4,frontmatter:{title:"那些年使用过的技术",date:"2018-05-18",category:"Others",tags:["杂"],math:null}}},pathContext:{prev:{url:null,title:null},slug:"/tools-used/",next:{url:"/electron-starter/",title:"Electron入门资料"}}}}});
